          body_original: "# \u95EE\u9898\n\u4ECA\u5929\u5728\u6298\u817E\u642D\u5EFAvuepress\u535A\u5BA2\uFF0C\u6253\u7B97\u628A\u8BED\u96C0\u5185\u5BB9\u8FC1\u79FB\u5230\u535A\u5BA2\uFF0C\u53D1\u73B0\u8BED\u96C0\u505A\u4E86\u9632\u76D7\u94FE\uFF0C\u5BFC\u81F4\u56FE\u7247\u65E0\u6CD5\u663E\u793A\u3002\n# \u5982\u4F55\u89E3\u51B3\u5462\uFF1F\u{1F926}\u200D\n\u5728\u7F51\u4E0A\u627E\u4E86\u4E00\u5708\uFF0C\u8BD5\u9519\u4E86\u597D\u51E0\u4E2A\u5C0F\u65F6\uFF0C\u773C\u82B1\u8170\u75BC\u7EC8\u4E8E\u627E\u5230\u4E86\u89E3\u51B3\u65B9\u6848\uFF01\u{1F929}\n\n\u{1F600} \u4F7F\u7528picGo\u56FE\u5E8A\u5DE5\u5177+typora\n\npicGo \u662F\u4E00\u4E2A\u96C6\u6210\u5404\u5927\u4E91\u5B58\u50A8\u7684\u5DE5\u5177\uFF0C\u7701\u53BB\u4E86\u5404\u79CD\u914D\u7F6E\uFF0C\u4E00\u952E\u4E0A\u4F20\u4E91\u5E73\u53F0\u3002\npicGo \u642D\u914D typora\u4F7F\u7528\uFF0C\u64CD\u4F5Cmd\u6587\u6863\u540E\uFF0C\u53EF\u76F4\u63A5\u53F3\u952E\u4E0A\u4F20\u4E91\u5E73\u53F0\u3002\u518D\u4E5F\u4E0D\u7528\u62C5\u5FC3\u56FE\u7247\u5931\u6548\u95EE\u9898\u5566\uFF01\n![image.png](https://cdn.nlark.com/yuque/0/2023/png/1450835/1691416081009-d149a4a6-181a-454f-b325-2bd5a4637f2e.png#averageHue=%23f3f0ed&clientId=u5368eaf8-c366-4&from=paste&height=246&id=u927004bf&originHeight=608&originWidth=1480&originalType=binary&ratio=2.4750001430511475&rotation=0&showTitle=false&size=284304&status=done&style=none&taskId=ud64d6bc7-6b13-4cb6-8e46-de07db21f83&title=&width=597.9797634174985)\n# \u914D\u7F6E\n## picgo\n\u6211\u8FD9\u91CC\u4F7F\u7528\u7684\u963F\u91CC\u4E91oss\u4F5C\u4E3A\u56FE\u5E8A\uFF0C\u5982\u4F7F\u7528\u5176\u4ED6\u4E91\u5B58\u50A8\uFF0C\u53EF\u53C2\u8003\u5982\u4E0B\u914D\u7F6E\n![image.png](https://cdn.nlark.com/yuque/0/2023/png/1450835/1691416043797-92f45cb0-1d01-45ce-be89-2e33b46b7769.png#averageHue=%235e5c58&clientId=u5368eaf8-c366-4&from=paste&height=364&id=u7d738242&originHeight=900&originWidth=1578&originalType=binary&ratio=2.4750001430511475&rotation=0&showTitle=false&size=143620&status=done&style=none&taskId=u88f16f6a-25f4-4121-a671-924340ff45f&title=&width=637.5757207248733)\n## typora\ntypora\u9700\u8981\u8BBE\u7F6E\u4E24\u9879\uFF1A\n1\u3001\u63D2\u5165\u56FE\u7247\u65F6\u64CD\u4F5C\uFF1A\u5982\u4E0B\u56FE\u914D\u7F6E\u3001\u5728\u63D2\u5165\u56FE\u50CF\u65F6\u76F4\u63A5\u4E0A\u4F20picgo\u914D\u7F6E\u7684\u4E91\u5B58\u50A8\u5E73\u53F0\u3002\n2\u3001\u4E0A\u4F20\u670D\u52A1\u914D\u7F6E\uFF1A\u9009\u62E9picgo\u4E0A\u4F20\u670D\u52A1\u3001\u4EE5\u53CApicgo\u5B89\u88C5\u76EE\u5F55\n \n![image.png](https://cdn.nlark.com/yuque/0/2023/png/1450835/1691416134360-67fd5a2d-095d-4d4f-be91-8dd1bb559cf7.png#averageHue=%23f5f4f4&clientId=u5368eaf8-c366-4&from=paste&height=521&id=u96e26d6d&originHeight=1290&originWidth=1574&originalType=binary&ratio=2.4750001430511475&rotation=0&showTitle=false&size=134360&status=done&style=none&taskId=uf965da3d-f2a2-4277-8e25-ce6ca357f0c&title=&width=635.9595592021234)\n# \u4E0B\u8F7D\u5730\u5740\uFF1A\npicgo \u5EFA\u8BAE\u5B89\u88C5 2.3\u7A33\u5B9A\u7248\u672C\ntypora \u5B89\u88C5\u7834\u89E3\u7248 \n\u5173\u6CE8\u516C\u4F17\u53F7\u3010\u7A0B\u5E8F\u5458\u738B\u5929\u3011\u9886\u53D6\u5B89\u88C5\u5305\n",
